import { SxProps } from '@mui/material';
import { blue } from '@mui/material/colors';

export const footerStyle: SxProps = {
	width: '100%',
	color: blue[800],
	letterSpacing: 1,
	fontSize: 'default',
	textAlign: 'center',
	fontWeight: 'bold'
};
